    public String get( String url ) throws Exception {
        return get(url, charset, null, null);
    }
    
    public String get( String url, String charset ) throws Exception {
        return get(url, charset, connTimeout, readTimeout);
    }
    
    /**
     * 지정된 문자 세트 인코딩을 사용하여 POST 요청을 보냅니다.
     * 
     * @param url1 Active URL
     * @param body RequestBody
     * @param mimeType 예를들면 "application/json", "application/xml", "application/x-www-form-urlencoded"
     * @param charset 인코딩
     * @param connTimeout 링크 타임 아웃 (밀리 초)을 설정합니다.
     * @param readTimeout 응답 시간 초과 (밀리 초).
     * @return ResponseBody, 지정된 문자 세트 인코딩를 사용하여.
     * @throws ConnectTimeoutException 연결 타임 아웃 Exception
     * @throws SocketTimeoutException 응답 시간 초과
     * @throws Exception
     */
    public String post( String activeUrl, String body, String mimeType, String charset, Integer connTimeout, Integer readTimeout ) throws ConnectTimeoutException, SocketTimeoutException, Exception {
        HttpClient client = null;
        HttpPost post = null;
        String result = "";
        try {
            post = new HttpPost(activeUrl);
            
            if (StringUtils.isNotBlank(body)) {
                HttpEntity entity = new StringEntity(body, ContentType.create(mimeType, charset));
                post.setEntity(entity);
            }
            // 매개변수설정
            Builder customReqConf = RequestConfig.custom();
            if (connTimeout != null) {
                customReqConf.setConnectTimeout(connTimeout);
            }
            if (readTimeout != null) {
                customReqConf.setSocketTimeout(readTimeout);
            }
            post.setConfig(customReqConf.build());
            
            HttpResponse res;
            if (activeUrl.startsWith("https")) {
                // HTTPS 요청을 수행합니다.
                client = createSSLInsecureClient();
                res = client.execute(post);
            } else {
                // HTTP 요청을 수행합니다.
                client = this.client;
                res = client.execute(post);
            }
            result = IOUtils.toString(res.getEntity().getContent(), charset);
        } catch (Exception e2) {
            throw new Exception(e2.getMessage());
        } finally {
            post.releaseConnection();
            if (activeUrl.startsWith("https") && client != null && client instanceof CloseableHttpClient) {
                ( (CloseableHttpClient)client ).close();
            }
        }
        
        return result;
    }
    
    /**
     * 지정된 문자 세트 인코딩을 사용하여 POST 요청을 보냅니다.
     * 
     * @param url1 Active URL
     * @param url2 standByUrl URL
     * @param body RequestBody
     * @param mimeType 예를들면 "application/json", "application/xml", "application/x-www-form-urlencoded"
     * @param charset 인코딩
     * @param connTimeout 링크 타임 아웃 (밀리 초)을 설정합니다.
     * @param readTimeout 응답 시간 초과 (밀리 초).
     * @return ResponseBody, 지정된 문자 세트 인코딩를 사용하여.
     * @throws ConnectTimeoutException 연결 타임 아웃 Exception
     * @throws SocketTimeoutException 응답 시간 초과
     * @throws Exception
     */
    public String post( String activeUrl, String standByUrl, String body, String mimeType, String charset, Integer connTimeout, Integer readTimeout ) throws ConnectTimeoutException, SocketTimeoutException, Exception {
        HttpClient client = null;
        HttpPost post = null;
        String result = "";
        try {
            post = new HttpPost(activeUrl);
            
            if (StringUtils.isNotBlank(body)) {
                HttpEntity entity = new StringEntity(body, ContentType.create(mimeType, charset));
                post.setEntity(entity);
            }
            // 매개변수설정
            Builder customReqConf = RequestConfig.custom();
            if (connTimeout != null) {
                customReqConf.setConnectTimeout(connTimeout);
            }
            if (readTimeout != null) {
                customReqConf.setSocketTimeout(readTimeout);
            }
            post.setConfig(customReqConf.build());
            
            HttpResponse res;
            if (activeUrl.startsWith("https")) {
                // HTTPS 요청을 수행합니다.
                client = createSSLInsecureClient();
                res = client.execute(post);
            } else {
                // HTTP 요청을 수행합니다.
                client = this.client;
                res = client.execute(post);
            }
            result = IOUtils.toString(res.getEntity().getContent(), charset);
        } catch (Exception e) {
            /**
             * Active URL에서 오류가 발생하면 Standby URL 을 실행함.
             */
            try {
                post = new HttpPost(standByUrl);
                
                if (StringUtils.isNotBlank(body)) {
                    HttpEntity entity = new StringEntity(body, ContentType.create(mimeType, charset));
                    post.setEntity(entity);
                }
                // 매개변수설정
                Builder customReqConf = RequestConfig.custom();
                if (connTimeout != null) {
                    customReqConf.setConnectTimeout(connTimeout);
                }
                if (readTimeout != null) {
                    customReqConf.setSocketTimeout(readTimeout);
                }
                post.setConfig(customReqConf.build());
                
                HttpResponse res;
                if (standByUrl.startsWith("https")) {
                    // HTTPS 요청을 수행합니다.
                    client = createSSLInsecureClient();
                    res = client.execute(post);
                } else {
                    // HTTP 요청을 수행합니다.
                    client = this.client;
                    res = client.execute(post);
                }
                result = IOUtils.toString(res.getEntity().getContent(), charset);
            } catch (Exception e2) {
                throw new Exception(e2.getMessage());
            } finally {
                post.releaseConnection();
                if (standByUrl.startsWith("https") && client != null && client instanceof CloseableHttpClient) {
                    ( (CloseableHttpClient)client ).close();
                }
            }
            
        } finally {
            post.releaseConnection();
            if (activeUrl.startsWith("https") && client != null && client instanceof CloseableHttpClient) {
                ( (CloseableHttpClient)client ).close();
            }
        }
        
        return result;
    }
    
    /**
     * form 양식 제출
     * 
     * @param url
     * @param params
     * @param connTimeout
     * @param readTimeout
     * @return
     * @throws ConnectTimeoutException
     * @throws SocketTimeoutException
     * @throws Exception
     */
    public String postForm( String url, Map<String, String> params, Map<String, String> headers, Integer connTimeout, Integer readTimeout ) throws ConnectTimeoutException, SocketTimeoutException, Exception {
        
        HttpClient client = null;
        HttpPost post = new HttpPost(url);
        try {
            if (params != null && !params.isEmpty()) {
                List<NameValuePair> formParams = new ArrayList<org.apache.http.NameValuePair>();
                Set<Entry<String, String>> entrySet = params.entrySet();
                for (Entry<String, String> entry : entrySet) {
                    formParams.add(new BasicNameValuePair(entry.getKey(), entry.getValue()));
                }
                UrlEncodedFormEntity entity = new UrlEncodedFormEntity(formParams, Consts.UTF_8);
                post.setEntity(entity);
            }
            
            if (headers != null && !headers.isEmpty()) {
                for (Entry<String, String> entry : headers.entrySet()) {
                    post.addHeader(entry.getKey(), entry.getValue());
                }
            }
            // 매개변수설정
            Builder customReqConf = RequestConfig.custom();
            if (connTimeout != null) {
                customReqConf.setConnectTimeout(connTimeout);
            }
            if (readTimeout != null) {
                customReqConf.setSocketTimeout(readTimeout);
            }
            post.setConfig(customReqConf.build());
            HttpResponse res = null;
            if (url.startsWith("https")) {
                // HTTPS 요청을 수행합니다.
                client = createSSLInsecureClient();
                res = client.execute(post);
            } else {
                // HTTP 요청을 수행합니다.
                client = this.client;
                res = client.execute(post);
            }
            return IOUtils.toString(res.getEntity().getContent(), "UTF-8");
        } finally {
            post.releaseConnection();
            if (url.startsWith("https") && client != null && client instanceof CloseableHttpClient) {
                ( (CloseableHttpClient)client ).close();
            }
        }
    }
    
    /**
     * GET 요청을 보내기
     * 
     * @param url
     * @param charset
     * @param connTimeout 링크 타임 아웃 (밀리 초)을 설정합니다.
     * @param readTimeout 응답 시간 초과 (밀리 초).
     * @return
     * @throws ConnectTimeoutException 링크 타임 아웃을 설정
     * @throws SocketTimeoutException 응답 시간 초과
     * @throws Exception
     */
    public String get( String url, String charset, Integer connTimeout, Integer readTimeout ) throws ConnectTimeoutException, SocketTimeoutException, Exception {
        
        HttpClient client = null;
        HttpGet get = new HttpGet(url);
        String result = "";
        try {
            // 매개변수설정
            Builder customReqConf = RequestConfig.custom();
            if (connTimeout != null) {
                customReqConf.setConnectTimeout(connTimeout);
            }
            if (readTimeout != null) {
                customReqConf.setSocketTimeout(readTimeout);
            }
            get.setConfig(customReqConf.build());
            
            HttpResponse res = null;
            
            if (url.startsWith("https")) {
                // HTTPS 요청을 수행합니다.
                client = createSSLInsecureClient();
                res = client.execute(get);
            } else {
                // HTTP 요청을 수행합니다.
                client = this.client;
                res = client.execute(get);
            }
            
            result = IOUtils.toString(res.getEntity().getContent(), charset);
        } finally {
            get.releaseConnection();
            if (url.startsWith("https") && client != null && client instanceof CloseableHttpClient) {
                ( (CloseableHttpClient)client ).close();
            }
        }
        return result;
    }
    
    /**
     * response 에서 charset 추출
     * 
     * @param ressponse
     * @return
     */
    @SuppressWarnings( "unused" )
    private String getCharsetFromResponse( HttpResponse ressponse ) {
        // Content-Type:text/html; charset=URF-8
        if (ressponse.getEntity() != null && ressponse.getEntity().getContentType() != null && ressponse.getEntity().getContentType().getValue() != null) {
            String contentType = ressponse.getEntity().getContentType().getValue();
            if (contentType.contains("charset=")) {
                return contentType.substring(contentType.indexOf("charset=") + 8);
            }
        }
        return null;
    }
    
    /**
     * SSL 연결 만들기
     * 
     * @return
     * @throws GeneralSecurityException
     */
    private CloseableHttpClient createSSLInsecureClient() throws GeneralSecurityException {
        try {
            SSLContext sslContext = new SSLContextBuilder().loadTrustMaterial(null, new TrustStrategy() {
                public boolean isTrusted( X509Certificate[] chain, String authType ) throws CertificateException {
                    return true;
                }
            }).build();
            
            SSLConnectionSocketFactory sslsf = new SSLConnectionSocketFactory(sslContext, new X509HostnameVerifier() {
                
                @Override
                public boolean verify( String arg0, SSLSession arg1 ) {
                    return true;
                }
                
                @Override
                public void verify( String host, SSLSocket ssl ) throws IOException {}
                
                @Override
                public void verify( String host, X509Certificate cert ) throws SSLException {}
                
                @Override
                public void verify( String host, String[] cns, String[] subjectAlts ) throws SSLException {}
                
            });
            
            return HttpClients.custom().setSSLSocketFactory(sslsf).build();
            
        } catch (GeneralSecurityException e) {
            throw e;
        }
    }
    
